import{_ as r,c as n,o as s,a,b as e,e as t}from"./app.14440598.js";const _='{"title":"VS.NET Project Templates","description":"","frontmatter":{"title":"VS.NET Project Templates","slug":"templates-overview"},"headers":[{"level":2,"title":"x new","slug":"x-new"},{"level":2,"title":"VS.NET Templates","slug":"vs-net-templates"},{"level":3,"title":"Visual Studio 2019","slug":"visual-studio-2019"},{"level":3,"title":"Visual Studio 2015 or 2013","slug":"visual-studio-2015-or-2013"},{"level":2,"title":"Available Project Templates","slug":"available-project-templates"},{"level":3,"title":"Webpack-powered Single Page App Templates","slug":"webpack-powered-single-page-app-templates"},{"level":3,"title":"Vue SPA Template","slug":"vue-spa-template"},{"level":3,"title":"AWS Lambda Template","slug":"aws-lambda-template"},{"level":3,"title":"Website Templates","slug":"website-templates"},{"level":3,"title":"Empty Starting Templates","slug":"empty-starting-templates"},{"level":3,"title":"ASP.NET Core Web Apps on .NET Framework","slug":"asp-net-core-web-apps-on-net-framework"},{"level":3,"title":"Desktop Templates","slug":"desktop-templates"},{"level":2,"title":"ServiceStackVS VS.NET Extension","slug":"servicestackvs-vs-net-extension"},{"level":3,"title":"Install ServiceStackVS","slug":"install-servicestackvs"},{"level":2,"title":"Example Projects","slug":"example-projects"},{"level":3,"title":"TypeScript React VS.NET Template","slug":"typescript-react-vs-net-template"},{"level":3,"title":"React Desktop Apps","slug":"react-desktop-apps"},{"level":3,"title":"React App Template","slug":"react-app-template"},{"level":3,"title":"AngularJS App Template","slug":"angularjs-app-template"},{"level":3,"title":"Integrated HTML, CSS and JavaScript Minifiers","slug":"integrated-html-css-and-javascript-minifiers"},{"level":2,"title":"Example Single Page App Projects","slug":"example-single-page-app-projects"}],"relativePath":"templates-overview.md","lastUpdated":1634495308450}',i={},l=a(`<p>ServiceStack has its strong foundations as a Web and MQ Services framework whose <a href="http://razor.servicestack.net/" target="_blank" rel="noopener noreferrer">easy and versatile HTML support</a> makes it the ideal services framework to create Backend Systems and Web APIs, Websites, Single Page Apps, Windows Services, Self-Hosting Console Apps and Rich OSX and Winforms Desktop Apps.</p><h2 id="x-new" tabindex="-1">x new <a class="header-anchor" href="#x-new" aria-hidden="true">#</a></h2><p>All ServiceStack Project Templates can be found and installed using the <a href="/web-new.html">x new</a> .NET Core tool that can be installed with:</p><div class="language-bash"><pre><code>$ dotnet tool <span class="token function">install</span> --global x 
</code></pre></div><p>Then run <code>x new</code> to view the list of available project templates:</p><div class="language-bash"><pre><code>$ x new
</code></pre></div><p>To upgrade to the latest version, run:</p><div class="language-bash"><pre><code>$ dotnet tool update -g x
</code></pre></div><h2 id="vs-net-templates" tabindex="-1"><a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> Templates <a class="header-anchor" href="#vs-net-templates" aria-hidden="true">#</a></h2><p>A limited selection of .NET Framework project templates can also be created inside <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> using the <a href="/templates-overview.html#servicestackvs-vsnet-extension">ServiceStackVS VS.NET Extension</a></p><p><img src="https://raw.githubusercontent.com/ServiceStack/docs/master/docs/images/ssvs/new-projects-dialog.png" alt="ServiceStack VS.NET Templates Dialog"></p><ul><li><a href="/create-your-first-webservice.html">ServiceStack ASP.NET Empty</a></li><li><a href="https://github.com/ServiceStackApps/SocialBootstrapApi" target="_blank" rel="noopener noreferrer">ServiceStack ASP.NET MVC4</a></li><li><a href="https://github.com/ServiceStackApps/EmailContacts" target="_blank" rel="noopener noreferrer">ServiceStack ASP.NET Razor with Bootstrap</a></li><li><a href="https://sharpscript.net/docs/sharp-pages" target="_blank" rel="noopener noreferrer">ServiceStack ASP.NET Sharp Pages with Bootstrap</a></li><li><a href="/self-hosting.html">Self Host Empty</a></li><li><a href="http://razor.servicestack.net/#runs-everywhere" target="_blank" rel="noopener noreferrer">Self Host with Razor</a></li><li><a href="/templates-windows-service.html">Windows Service Empty</a></li><li><a href="/templates-aspnet-empty.html">ASP.NET Empty</a></li><li><a href="/templates-angularjs-v15.html">AngularJS 1.5 App</a></li></ul><h3 id="visual-studio-2019" tabindex="-1">Visual Studio 2019 <a class="header-anchor" href="#visual-studio-2019" aria-hidden="true">#</a></h3><p>The latest <strong>ServiceStackVS</strong> from v2+ includes support for Visual Studio 2019:</p><p><img src="https://raw.githubusercontent.com/ServiceStack/docs/master/docs/images/ssvs/vs2019-install-vue.gif" alt=""></p><h3 id="visual-studio-2015-or-2013" tabindex="-1">Visual Studio 2015 or 2013 <a class="header-anchor" href="#visual-studio-2015-or-2013" aria-hidden="true">#</a></h3><p>If you&#39;re still using <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> 2015 or 2013 you can use the earlier <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> ServiceStackVS extension:</p><ul><li><a href="https://github.com/ServiceStack/ServiceStackVS/raw/master/dist/2018/ServiceStackVS.vsix" target="_blank" rel="noopener noreferrer">ServiceStackVS.vsix</a></li></ul><h2 id="available-project-templates" tabindex="-1">Available Project Templates <a class="header-anchor" href="#available-project-templates" aria-hidden="true">#</a></h2><p>ServiceStack is available in a number of popular starting configurations below:</p><h3 id="webpack-powered-single-page-app-templates" tabindex="-1">Webpack-powered Single Page App Templates <a class="header-anchor" href="#webpack-powered-single-page-app-templates" aria-hidden="true">#</a></h3><p>All <a href="/templates-single-page-apps.html">VS.NET Single Page App templates</a> are powered by <a href="https://webpack.js.org" target="_blank" rel="noopener noreferrer">Webpack</a> which handles the development, testing and production builds of your Web App. See the <a href="/templates-single-page-apps.html">Webpack Template Docs</a> for an overview for how to utilize the templates features.</p><p>The <a href="#servicestackvs-vsnet-extension">ServiceStackVS VS.NET extension</a> contains a pre-configured Single Page App <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> template for each of the popular JavaScript frameworks:</p><ul><li>Angular App</li><li>Aurelia App</li><li>React App</li><li>React Desktop Apps</li><li>Vue App</li><li>AngularJS 1.5 Lite App</li></ul><p><a href="/templates-single-page-apps.html"><img src="https://raw.githubusercontent.com/ServiceStack/docs/master/docs/images/ssvs/spa-templates-overview.png" alt=""></a></p><h3 id="vue-spa-template" tabindex="-1"><a href="https://github.com/NetCoreTemplates/vue-spa" target="_blank" rel="noopener noreferrer">Vue SPA Template</a> <a class="header-anchor" href="#vue-spa-template" aria-hidden="true">#</a></h3>`,26),o=e("iframe",{width:"896",height:"525",src:"https://www.youtube.com/embed/4HphWPrKwb0",frameborder:"0",allow:"autoplay; encrypted-media",allowfullscreen:""},null,-1),p=e("blockquote",null,[e("p",null,[t("YouTube: "),e("a",{href:"https://youtu.be/4HphWPrKwb0",target:"_blank",rel:"noopener noreferrer"},"https://youtu.be/4HphWPrKwb0")])],-1),c=e("h3",{id:"aws-lambda-template",tabindex:"-1"},[e("a",{href:"https://github.com/NetCoreTemplates/aws-lambda",target:"_blank",rel:"noopener noreferrer"},"AWS Lambda Template"),t(),e("a",{class:"header-anchor",href:"#aws-lambda-template","aria-hidden":"true"},"#")],-1),h=e("p",null,"This project lets you create a .NET 5 empty ServiceStack web project ready for deployment as a AWS Lambda Function wired with API GateWay and packaged via a Docker image.",-1),d=e("iframe",{width:"896",height:"525",src:"https://www.youtube.com/embed/8mpGNTsSlvE",frameborder:"0",allow:"autoplay; encrypted-media",allowfullscreen:""},null,-1),m=a('<blockquote><p>YouTube: <a href="https://youtu.be/8mpGNTsSlvE" target="_blank" rel="noopener noreferrer">https://youtu.be/8mpGNTsSlvE</a></p></blockquote><h3 id="website-templates" tabindex="-1">Website Templates <a class="header-anchor" href="#website-templates" aria-hidden="true">#</a></h3><p><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/csharp-templates/web.png" alt=""></p><p><a href="/templates-websites.html">Website Templates</a> contain popular starting Templates for creating Server HTML Generated Websites and HTTP APIs with ServiceStack.</p><h3 id="empty-starting-templates" tabindex="-1">Empty Starting Templates <a class="header-anchor" href="#empty-starting-templates" aria-hidden="true">#</a></h3><p><a href="/templates-websites.html">Empty Web and Self Hosting Console and Windows Service Templates</a>.</p><h3 id="asp-net-core-web-apps-on-net-framework" tabindex="-1"><a href="http://ASP.NET" target="_blank" rel="noopener noreferrer">ASP.NET</a> Core Web Apps on .NET Framework <a class="header-anchor" href="#asp-net-core-web-apps-on-net-framework" aria-hidden="true">#</a></h3><p>Popular starting templates for creating <a href="/templates-corefx.html">ASP.NET Core templates on the .NET Framework</a>.</p><h3 id="desktop-templates" tabindex="-1">Desktop Templates <a class="header-anchor" href="#desktop-templates" aria-hidden="true">#</a></h3><p><a href="/templates-desktop.html">Desktop Templates</a> for packaging your ServiceStack Web App into different Native Desktop UIs.</p><h2 id="servicestackvs-vs-net-extension" tabindex="-1">ServiceStackVS <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> Extension <a class="header-anchor" href="#servicestackvs-vs-net-extension" aria-hidden="true">#</a></h2><p><a href="https://visualstudiogallery.msdn.microsoft.com/5bd40817-0986-444d-a77d-482e43a48da7" target="_blank" rel="noopener noreferrer">ServiceStackVS</a> supports Visual Studio 2017, 2015 and 2013 and can be installed from within <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a>:</p><h3 id="install-servicestackvs" tabindex="-1">Install ServiceStackVS <a class="header-anchor" href="#install-servicestackvs" aria-hidden="true">#</a></h3><p>Install the ServiceStackVS <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> Extension by going to <code>Tools &gt; Extensions and Updates...</code></p><p><a href="https://raw.githubusercontent.com/ServiceStack/ServiceStackVS/master/Images/tools_extensions.png" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/ServiceStackVS/master/Images/tools_extensions.png" alt=""></a></p><p>Then searching the Visual Studio Gallery for <strong>ServiceStack</strong></p><p><a href="https://raw.githubusercontent.com/ServiceStack/ServiceStackVS/master/Images/search_download.png" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/ServiceStackVS/master/Images/search_download.png" alt=""></a></p><p>Optionally it can be downloaded and installed from the <a href="http://visualstudiogallery.msdn.microsoft.com/5bd40817-0986-444d-a77d-482e43a48da7" target="_blank" rel="noopener noreferrer">VS.NET Gallery</a></p><p><a href="http://visualstudiogallery.msdn.microsoft.com/5bd40817-0986-444d-a77d-482e43a48da7" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/servicestackvs/vsgallery-download.png" alt="VS.NET Gallery Download"></a></p><h2 id="example-projects" tabindex="-1">Example Projects <a class="header-anchor" href="#example-projects" aria-hidden="true">#</a></h2><p>The Example projects below contain a working demo including further documentation about each of their templates they were built with:</p><h3 id="typescript-react-vs-net-template" tabindex="-1">TypeScript React <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> Template <a class="header-anchor" href="#typescript-react-vs-net-template" aria-hidden="true">#</a></h3><p><a href="https://github.com/ServiceStackApps/typescript-react-template/" target="_blank" rel="noopener noreferrer">TypeScript React Template</a> incorporates today&#39;s best-in-class technologies for developing rich, complex JavaScript Apps within <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> and encapsulated within ServiceStack&#39;s new <a href="https://github.com/ServiceStackApps/typescript-react-template/" target="_blank" rel="noopener noreferrer">TypeScript React VS.NET Template</a> providing an instant integrated client and .NET server solution where you&#39;ll be immediately productive out-of-the-box whilst enabling an optimal iterative development experience with pre-configured Gulp tasks that takes care of effortlessly packaging, bundling and deploying your next App.</p><h3 id="react-desktop-apps" tabindex="-1">React Desktop Apps <a class="header-anchor" href="#react-desktop-apps" aria-hidden="true">#</a></h3><p><a href="https://github.com/ServiceStackApps/ReactDesktopApps" target="_blank" rel="noopener noreferrer">React Desktop Apps</a> take advantage of the adaptability, navigation and deep-linking benefits of a Web-based UI, the productivity and responsiveness of the <a href="https://facebook.github.io/react/" target="_blank" rel="noopener noreferrer">React framework</a>, the performance, rich features and functionality contained in <a href="https://github.com/ServiceStack/ServiceStack/wiki" target="_blank" rel="noopener noreferrer">ServiceStack</a> and the .NET Framework combined with the native experience and OS Integration possible from a Native Desktop App - all within a single VS .NET template!</p><h3 id="react-app-template" tabindex="-1">React App Template <a class="header-anchor" href="#react-app-template" aria-hidden="true">#</a></h3><p>The <a href="https://github.com/ServiceStackApps/ReactChat" target="_blank" rel="noopener noreferrer">ReactJS App VS.NET Template</a> enables an optimal iterative dev experience for creating optimized Single Page React.js Apps. It shares the same approach for developing modern Single Page Apps in <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> as the <a href="https://github.com/ServiceStack/ServiceStackVS/blob/master/docs/angular-spa.md" target="_blank" rel="noopener noreferrer">AngularJS App Template</a> by leveraging the node.js ecosystem for managing all aspects of Client App development and using the best-in-class libraries.</p><h3 id="angularjs-app-template" tabindex="-1">AngularJS App Template <a class="header-anchor" href="#angularjs-app-template" aria-hidden="true">#</a></h3><p>The <a href="https://github.com/ServiceStack/ServiceStackVS/blob/master/docs/angular-spa.md" target="_blank" rel="noopener noreferrer">AngularJS App</a> template in <a href="/create-your-first-webservice.html">ServiceStackVS</a> provides a modern opinionated web technology stack for developing rich Single Page Apps with <a href="https://angularjs.org" target="_blank" rel="noopener noreferrer">AngularJS</a> and ServiceStack.</p><h3 id="integrated-html-css-and-javascript-minifiers" tabindex="-1"><a href="/html-css-and-javascript-minification.html">Integrated HTML, CSS and JavaScript Minifiers</a> <a class="header-anchor" href="#integrated-html-css-and-javascript-minifiers" aria-hidden="true">#</a></h3><p>For normal server-generated websites that don&#39;t leverage Webpack to bundle their outputs you can take advantage of ServiceStack&#39;s integrated and non-invasive minification features to effortlessly enable <a href="/html-css-and-javascript-minification.html">HTML, CSS and JavaScript minification to your existing Website</a>.</p><h1 id="community-resources" tabindex="-1">Community Resources <a class="header-anchor" href="#community-resources" aria-hidden="true">#</a></h1><ul><li><a href="http://iwayneo.blogspot.co.uk/2014/10/hosting-ember-cli-app-inside.html" target="_blank" rel="noopener noreferrer">Hosting an ember-cli app inside a ServiceStack (or any) MVC app</a> by <a href="https://twitter.com/wayne_douglas" target="_blank" rel="noopener noreferrer">@wayne_douglas</a></li><li><a href="http://www.layoric.org/2014/01/servicestack-angulardart-getting-started.html" target="_blank" rel="noopener noreferrer">ServiceStack + AngularDart - Getting Started</a> by <a href="https://twitter.com/layoric" target="_blank" rel="noopener noreferrer">@layoric</a></li><li><a href="https://github.com/dnauck/License.Manager" target="_blank" rel="noopener noreferrer">License manager for Portable.Licensing using AngularJS and ServiceStack</a> by <a href="https://github.com/dnauck" target="_blank" rel="noopener noreferrer">@dnauck</a></li><li><a href="https://github.com/paaschpa/ordersDemo" target="_blank" rel="noopener noreferrer">StarBucks-like real-time ordering fulfillment Single Page App built with ServiceStack, AngularJS, SignalR and Redis</a> by <a href="https://twitter.com/paaschpa" target="_blank" rel="noopener noreferrer">@paaschpa</a></li><li><a href="http://joeriks.com/2013/05/02/some-thoughts-in-between-spa-projects/" target="_blank" rel="noopener noreferrer">Some thoughts in between SPA projects</a> by <a href="https://twitter.com/joeriks" target="_blank" rel="noopener noreferrer">@joeriks</a></li><li><a href="http://openlandscape.net/2011/07/30/zippy-tips-working-with-servicestack-backbone-js-jquery-mono-develop-on-mac/" target="_blank" rel="noopener noreferrer">Zippy Tips Working With ServiceStack, Backbone.js, jQuery &amp; Mono-Develop on Mac</a> by <a href="http://openlandscape.net/about/" target="_blank" rel="noopener noreferrer">Jacques du Preez</a></li></ul><h2 id="example-single-page-app-projects" tabindex="-1">Example Single Page App Projects <a class="header-anchor" href="#example-single-page-app-projects" aria-hidden="true">#</a></h2><ul><li><a href="https://github.com/bradgearon/whats-cookin" target="_blank" rel="noopener noreferrer">Meal planning per configured interval powered by AngularJS, Bower and GruntJS</a></li><li><a href="https://github.com/ServiceStack/SocialBootstrapApi/" target="_blank" rel="noopener noreferrer">Backbone.js + Twitter Social Bootstrap API</a></li><li><a href="http://www.servicestack.net/RedisStackOverflow/" target="_blank" rel="noopener noreferrer">StackOverflow clone with Redis back-end</a></li><li><a href="http://www.servicestack.net/RedisAdminUI/AjaxClient/" target="_blank" rel="noopener noreferrer">Redis Admin UI built with Google Closure Library</a></li><li><a href="http://www.servicestack.net/Backbone.Todos/" target="_blank" rel="noopener noreferrer">Backbone Todos with Redis back-end</a></li><li><a href="http://www.servicestack.net/RestFiles/#!files" target="_blank" rel="noopener noreferrer">GitHub-like browser with complete remote file management over REST</a></li><li><a href="http://www.servicestack.net/docs/" target="_blank" rel="noopener noreferrer">ServiceStack Docs with PushState support</a></li><li><a href="http://razor.servicestack.net/rockstars?View=AngularJS" target="_blank" rel="noopener noreferrer">Angular JS View in RazorRockstars</a></li></ul>',35),g=[l,o,p,c,h,d,m];function S(u,f,b,v,k,w){return s(),n("div",null,g)}var A=r(i,[["render",S]]);export{_ as __pageData,A as default};
